import React from "react";
import { FaGithub } from 'react-icons/fa';

const ModalTwo = () => {
  return (
    <div className="popup_informations">
      <div className="image">
        <div
          className="main"
          style={{
            backgroundImage: `url(${'https://user-images.githubusercontent.com/95555052/161155910-f0ca577e-4860-4e47-ad5b-48ed7a451a54.png'})`,
            width: "108%"
          }}
        ></div>
      </div>
      {/* End big image */}

      <div className="description">
        <h3 style={{ display: "inline-block"}}>Travel Front-End Design</h3>
        <a href="https://github.com/ZachGleason/travel_website" target="_blank" style={{marginLeft: 20}}><FaGithub className="inlineStyle" style={{ height: 25, width: 25, color: "black", display: "inline-block", marginBottom: -5}}/></a>
        <p>
          A minimal design for a travel website, built using HTML, CSS, and Bootstrap
        </p>
      </div>
      <div >
        <h3 style={{ display: "inline-block"}}>Travel Front-End Design</h3>
        <a href="https://github.com/ZachGleason/travel_website" target="_blank" style={{marginLeft: 50}}><FaGithub className="inlineStyle" style={{ height: 25, width: 25, color: "black", display: "inline-block", marginTop: 100}}/></a>
        <p>
          A minimal design for a travel website, built using HTML, CSS, and Bootstrap
        </p>
      </div>
    </div>
  );
};

export default ModalTwo;
